import {mapGetters} from "vuex";
import cartComponent from "/Users/vishnupriya/Documents/vue js/vue_day1/src/components/cartComponent.vue"
export default
{
    name:"cartComponent",
    component:{
        cartComponent
    },
    computed:{
        ...mapGetters('cartstore',['cartitemsstore'])
    },
    methods:{
        increment()
        {
            document.getElementById('inc').stepup();
        },
        decrement(){
            return document.getElementById('dec').stepdown();
        }
    }

}
